    if (password.text === c_password.text) (console.log(Update_profile_EmailPassword.run()), showAlert(' เปลี่ยนพาสเวิร์ดสำเร็จ.', 'success'), closeModal('Modal1'), resetWidget('password'), resetWidget('c_password')); else console.log(showAlert(' กรุณากรอกพาสเวิร์ดให้ตรงกัน.', 'error'));
  }
}

